import React from 'react';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';
import DashboardIcon from '@material-ui/icons/Dashboard';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import PeopleIcon from '@material-ui/icons/People';
import BarChartIcon from '@material-ui/icons/BarChart';
import LayersIcon from '@material-ui/icons/Layers';
import AssignmentIcon from '@material-ui/icons/Assignment';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
// import ListItem from '@material-ui/core/ListItem';
// import ListItemIcon from '@material-ui/core/ListItemIcon';
// import ListItemText from '@material-ui/core/ListItemText';
import StarIcon from '@material-ui/icons/Star';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        maxWidth: 360,
        backgroundColor: theme.palette.background.paper,
    },
}));
export default function InsetList() {
    const classes = useStyles();

    return (
        <List component="nav" className={classes.root} aria-label="contacts">
            <ListItem button>
                <ListItemIcon>
                    <StarIcon />
                </ListItemIcon>
                <ListItemText primary="Chelsea Otakan" />
            </ListItem>
            <ListItem button>
                <ListItemText inset primary="Eric Hoffman" />
            </ListItem>
        </List>
    );
}




export const mainListItems = (

    <div>
        <ListItem button>
            <ListItemIcon>
                <DashboardIcon />
            </ListItemIcon>
            <ListItemText primary="Dashboard" />
        </ListItem>
        <ListItem button>
            <ListItemIcon>
                <ShoppingCartIcon />
            </ListItemIcon>
            <ListItemText primary="Branch/Courses" />
        </ListItem>
        <ListItem button>
            <ListItemIcon>
                <PeopleIcon />
            </ListItemIcon>
            <ListItemText primary="Colleges" />
        </ListItem>

        <ListItem button>
            <ListItemIcon></ListItemIcon>
            <ListItemText primary="All"/> 
        </ListItem>
        
        <ListItem button>
            <ListItemIcon></ListItemIcon>
            <ListItemText primary="Send Invitation"/>
        </ListItem>
        <ListItem button>
            <ListItemIcon></ListItemIcon>
            <ListItemText primary="Add College" /> 
        </ListItem>

        <ListItem button>
            <ListItemIcon>
                <BarChartIcon />
            </ListItemIcon>
            <ListItemText primary="Companies" />
        </ListItem>
        
        <ListItem button>
            <ListItemIcon>
                <LayersIcon />
            </ListItemIcon>
            <ListItemText primary="Students" />
            <ListItem>All Jobs</ListItem>
            <ListItem button>
                <ListItemText primary="All Jobs" />
                <ListItemText secondary="Open Jobs" />
                <ListItemText secondary="Application Status" />
                <ListItemText secondary="Closed Jobs" />
            </ListItem>

            <ListItem button>
                <ListItemText inset primary="All Jobs" />
            </ListItem>

        </ListItem>
    </div>
);

export const secondaryListItems = (
    <div>
        <ListSubheader inset>Saved reports</ListSubheader>
        <ListItem button>
            <ListItemIcon>
                <AssignmentIcon />
            </ListItemIcon>
            <ListItemText primary="Data" />
            <ListItemText /> Generate Report
            <ListItemText /> Update Youtube Links
            <ListItemText /> UPdate Blog Links
        </ListItem>
        <ListItem button>
            <ListItemIcon>
                <AssignmentIcon />
            </ListItemIcon>
            <ListItemText primary="Last quarter" />
        </ListItem>
        <ListItem button>
            <ListItemIcon>
                <AssignmentIcon />
            </ListItemIcon>
            <ListItemText primary="Year-end sale" />
        </ListItem>
    </div>
);
